import React, { useState } from "react";

const initialEvents = [
  {
    id: 1,
    title: "Hackathon 2025 – AI & Innovation",
    date: "20–21 Oct 2025, 9:00 AM",
    venue: "Computer Science Lab, Block A",
    seats: 30,
    description:
      "A 24-hour coding marathon to create real-world AI-based solutions. Teams collaborate and innovate using modern tech stacks.",
  },
  {
    id: 2,
    title: "Cybersecurity & Blockchain Workshop",
    date: "5–6 Nov 2025, 10:00 AM",
    venue: "IT Lab, Block B",
    seats: 25,
    description:
      "Hands-on sessions on Cybersecurity, Blockchain, and Cloud. Learn real-world protection and ledger security concepts.",
  },
  {
    id: 3,
    title: "Pre-Placement Talk 2025",
    date: "15 Nov 2025, 11:00 AM",
    venue: "Auditorium, Main Block",
    seats: 40,
    description:
      "Industry experts provide insights into placement preparation, interview cracking strategies, and building a solid career path.",
  },
  {
    id: 4,
    title: "Ideathon – Innovative Ideas Challenge",
    date: "25–26 Nov 2025, 10:00 AM",
    venue: "Innovation Lab, Block C",
    seats: 20,
    description:
      "A 2-day creative challenge where teams pitch innovative ideas to solve real-world issues using technology and design thinking.",
  },
];

function UserDashboard() {
  const [events, setEvents] = useState(initialEvents);
  const [registeredEvents, setRegisteredEvents] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  const handleRegister = (id) => {
    setEvents((prev) =>
      prev.map((event) =>
        event.id === id && event.seats > 0
          ? { ...event, seats: event.seats - 1 }
          : event
      )
    );

    const eventToAdd = events.find((event) => event.id === id);
    if (eventToAdd && !registeredEvents.find((e) => e.id === id)) {
      setRegisteredEvents([...registeredEvents, eventToAdd]);
    }
  };

  const handleSearch = (e) => {
    setSearchTerm(e.target.value.toLowerCase());
  };

  const filteredEvents = events.filter((event) =>
    event.title.toLowerCase().includes(searchTerm)
  );

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 to-white p-8">
      {/* Header */}
      <header className="flex justify-between items-center mb-8 backdrop-blur-md bg-white/60 shadow-md rounded-xl px-6 py-4">
        <h1 className="text-3xl font-bold text-blue-700">User Dashboard</h1>
        <input
          type="text"
          placeholder="Search events..."
          className="border border-gray-300 rounded-full px-4 py-2 w-1/3 focus:outline-none focus:ring focus:ring-blue-200"
          value={searchTerm}
          onChange={handleSearch}
        />
      </header>

      {/* Events Section */}
      <section>
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">
          Available Events
        </h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredEvents.map((event) => (
            <div
              key={event.id}
              className="backdrop-blur-md bg-white/70 border border-blue-100 rounded-2xl shadow-lg hover:shadow-2xl transition-transform transform hover:-translate-y-1 p-6"
            >
              <h3 className="text-xl font-bold text-blue-700 mb-2">
                {event.title}
              </h3>
              <p className="text-gray-700 font-medium">{event.date}</p>
              <p className="text-gray-500 text-sm mb-3">{event.venue}</p>
              <p className="text-gray-600 text-sm mb-4 line-clamp-3">
                {event.description}
              </p>
              <p className="text-sm text-blue-800 font-semibold mb-3">
                Seats left: {event.seats}
              </p>
              <div className="flex justify-between">
                <button
                  className="bg-blue-600 text-white px-4 py-2 rounded-full hover:bg-blue-700 transition"
                  onClick={() => alert(event.description)}
                >
                  View
                </button>
                <button
                  className={`px-4 py-2 rounded-full transition ${
                    event.seats > 0
                      ? "bg-green-500 hover:bg-green-600"
                      : "bg-gray-400 cursor-not-allowed"
                  } text-white`}
                  onClick={() => handleRegister(event.id)}
                  disabled={event.seats === 0}
                >
                  Register
                </button>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Registered Section */}
      <section className="mt-12">
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">
          Registered Events
        </h2>
        {registeredEvents.length === 0 ? (
          <p className="text-gray-500">
            You haven’t registered for any events yet.
          </p>
        ) : (
          <ul className="space-y-3">
            {registeredEvents.map((event) => (
              <li
                key={event.id}
                className="p-4 backdrop-blur-md bg-white/70 border border-blue-100 rounded-lg shadow-sm"
              >
                <span className="font-medium text-blue-700">{event.title}</span>{" "}
                — <span className="text-gray-500">{event.date}</span>
              </li>
            ))}
          </ul>
        )}
      </section>
    </div>
  );
}

export default UserDashboard;
